import React from 'react';
import classes from './Navbar.module.css';

const Navbar = (props) => {
    return (
        <div className={classes['navbar-box']}>
            <h2 className={classes['navbar-heading']}>React-Test</h2>
        </div>
    );
}

export default Navbar;
